import React, { useState } from "react";
import { ReactComponent as BigLogo } from './biglogo.svg';
import { ReactComponent as Logo } from './logo.svg';
import { ProSidebar, Menu, MenuItem, SidebarHeader, SidebarFooter, SidebarContent } from "react-pro-sidebar";
import { FaList } from "react-icons/fa";
import { FiHome, FiArrowLeftCircle, FiArrowRightCircle } from "react-icons/fi";
import { useNavigate, Link } from "react-router-dom";
import "react-pro-sidebar/dist/css/styles.css";
import "./Header.css";


const Header = () => {

    let navigate = useNavigate();

    const [menuCollapse, setMenuCollapse] = useState(false)

    const menuIconClick = () => {
        menuCollapse ? setMenuCollapse(false) : setMenuCollapse(true);
    };

    const linkstyle = {
        color: "#000080",
        padding: "10px"
      };

    return (
        <>
        <div id="header">
            <ProSidebar collapsed={menuCollapse}>
            <SidebarHeader>
                <div className="logotext">
                <p>{menuCollapse ? <Logo /> : <BigLogo />}</p>
                </div>
                <div className="closemenu" onClick={menuIconClick}>
                {menuCollapse ? (
                    <FiArrowRightCircle/>
                ) : (
                    <FiArrowLeftCircle/>
                )}
                </div>
            </SidebarHeader>
            <SidebarContent>
                <Menu iconShape="square">
                <MenuItem icon={<FiHome />} onClick={() => {navigate("/");}}>Home</MenuItem>
                <MenuItem icon={<FaList />} onClick={() => {navigate("/sites");}}>Sites</MenuItem>
                </Menu>
            </SidebarContent>
            <SidebarFooter>
                <Menu iconShape="square">
                <div className="logotext">
                <p style={{color: "#000080", padding: "10px"}}>{menuCollapse ? <Link style={{color: "#000080", padding: "10px"}} to="https://www.nshsf.org/">nshsf.org</Link> : 
                    <Link style={{color: "#000080"}} to="https://www.nshsf.org/">Nebraska State Historical Society Foundation</Link>}</p>
                </div>
                </Menu>
            </SidebarFooter>
            </ProSidebar>
        </div>
        </>
    );
};

export default Header;
